con:config.script:
//This script does the following to demonstrate Data Driven using excel sheet
//1.Create excel - contains customer details - "C:\SDET\Customer Test Data.xls"
//2. Create customer using above details
//3. After creation of 1 customer, store the cust id in custom property
//4. Delete the created customer using custom prop


import jxl.*
import com.eviware.soapui.support.XmlHolder
//fetch excel 
def filepath = "C:\SDET\Project\Customer_Test_Data.xls"

File Excel = new File(filepath)

Workbook wb = Workbook.getWorkbook(Excel)
Sheet sh = wb.getSheet("Sheet1")

//Fetch number of rows & cols
def row = sh.getRows().toInteger()
def column = sh.getColumns().toInteger()

log.info "no of rows is $row and no of cols is $column"

//1st col - username, 2nd col - pwd


for(def i=1;i<row;i++)
//for(def i=2;i<3;i++)
{
    for(def j=0;j<column;j++)
    {
        if(j==0)
        {
            email = sh.getCell(j,i).getContents()
        }
        else if(j==1)
        {
            fname = sh.getCell(j,i).getContents()
        }
        else
        {
        	lname = sh.getCell(j,i).getContents()
        }
    }
    log.info "Email is $email"
    log.info "First Name is $fname"
    log.info "Last Name is $lname"


    context.testCase.setPropertyValue("email", email)
    context.testCase.setPropertyValue("fname", fname)
    context.testCase.setPropertyValue("lname", lname)


	def tc = testRunner.testCase.getTestStepByName("Create Cust")
	tc.run(testRunner,context)

	def response = context.testCase.getTestStepByName('Create Cust').getPropertyValue("response")
	//it stores all my response
	def holder = new XmlHolder(response)
	//i fetched the sessionid afrom the response and stroing in a variable
	def id = holder.getNodeValue("//*:id")
	//When i want to store this varibale in a testcase Custom property
	context.testCase.setPropertyValue("CustId",id)

	 tc = testRunner.testCase.getTestStepByName("Delete Cust")
	tc.run(testRunner,context)







}

con:configuration.scriptText:
